import React, { useState, useEffect, useRef } from "react";

const Project = (props) => {
  let [hoverStatus, setHoverStatus] = useState(false);

  return (
    <div class="col-sm">
      <div
        class="card text-center project"
        onMouseEnter={() => setHoverStatus(true)}
        onMouseLeave={() => setHoverStatus(false)}
      >
        {hoverStatus ? (
          <p>
            Web-based trip planning tool for groups of travelers to streamline
            expenses
          </p>
        ) : (
          <h2>{props.title}</h2>
        )}

